The main entry point to the Command Line Interface (CLI) is through the main.rs file. This file is located in the Oxen/src/cli/src directory. Each command is defined in it's own submodule and implements the RunCmd trait. #[async_trait]
pub trait RunCmd { fn name(&self) -> &str; fn args(&self) -> clap::Command; async fn run(&self, args: &clap::ArgMatches) -> Result<(), OxenError>;
} These submodules can be found in cmd subdirectory. They are named after the command they implement. For example if you are curious how oxen add is implemented, you would look at add.rs .

