We are all smart software engineers, but when it comes to entering a new codebase we all want confidence that making a change doesn't have a cascading effect. It is important to make sure that turning off the (proverbial) lights in the kitchen üí° doesn't make the roof collapse üè†. Luckily each command within Oxen has a well defined interface, and each command can be tested independently. For example: // Initialize Repo
let repo = command::init("./test_repo")?;
// Add File
command::add(&repo, &"hello.txt")?;
// Commit File
command::commit(&repo, &"add hello.txt")?; We chain these commands together into a sequence of integration and unit tests to make sure the end to end system works as expected.

