In order to understand the Commit object better, let's look at how it is stored on disk. Again we are going to peek in the .oxen directory as our starting point. Specifically at the commits directory. $ ls .oxen/commits 000008.sst 000014.log IDENTITY LOG OPTIONS-000012
000013.sst CURRENT LOCK MANIFEST-000015 OPTIONS-000017 This entire directory is the commits database. Under the hood Oxen stores most of it's data with RocksDB . This is a fast key-value store that makes it fast to insert and read data without loading the entire database into memory. Specifically we use the rust bindings for RocksDB found in this repository . These files are hard to inspect on their own, so we can use the oxen db command to inspect the commits database. The oxen db list command will print out all the commits in the database. $ oxen db list .oxen/commits You'll see this prints the entire key value store as tab separated values. 2c610ae8e424a4c8	{"id":"2c610ae8e424a4c8","parent_ids":["440b54a690b44fd7"],"message":"Add hello.txt and world.txt","author":"oxbot","email":"oxbot@oxen.ai","root_hash":"cf2c5e5f057b589230654260d07fa7c3","timestamp":"2024-05-23T00:40:20.555747Z"}
440b54a690b44fd7	{"id":"440b54a690b44fd7","parent_ids":[],"message":"Initialized Repo üêÇ","author":"oxbot","email":"oxbot@oxen.ai","root_hash":"99aa06d3014798d86001c324468d497f","timestamp":"2024-05-23T00:40:02.047406Z"}
a36e6239a1ab49d4	{"id":"a36e6239a1ab49d4","parent_ids":["2c610ae8e424a4c8"],"message":"Update hello.txt","author":"oxbot","email":"oxbot@oxen.ai","root_hash":"7121f5302a90ea338f129ca169a39739","timestamp":"2024-05-23T00:43:53.303893Z"} If you want to get a specific commit, you can use the oxen db get command. For example, to get the commit 2c610ae8e424a4c8, you can run the following command. $ oxen db get .oxen/commits/ 2c610ae8e424a4c8 | jq { "id": "2c610ae8e424a4c8", "parent_ids": [ "440b54a690b44fd7" ], "message": "Add hello.txt and world.txt", "author": "oxbot", "email": "oxbot@oxen.ai", "timestamp": "2024-05-23T00:40:20.555747Z"
} Ah, there is a nice beautiful commit object. You can see that the raw values are simply stored in the db as json. There is a list of parent commit ids, a message, the author, the email, and the timestamp.
